import React, { useCallback, useEffect, useState } from "react";
import MasterLayout from "../MasterLayout";
import { connect, useDispatch } from "react-redux";
import moment from "moment";
import ReactDataTable from "../../shared/table/ReactDataTable";
import ActionDropDownButton from "../../shared/action-buttons/ActionDropDownButton";
import TabTitle from "../../shared/tab-title/TabTitle";
import { fetchPurchases } from "../../store/action/purchaseAction";
import DeletePurchase from "./DeletePurchase";
import { fetchAllSuppliers } from "../../store/action/supplierAction";
import { fetchAllWarehouses } from "../../store/action/warehouseAction";
import status from "../../shared/option-lists/status.json";
import {
    currencySymbolHendling,
    getFormattedDate,
    placeholderText,
} from "../../shared/sharedMethod";
import { getFormattedMessage } from "../../shared/sharedMethod";
import { purchasePdfAction } from "../../store/action/purchasePdfAction";
import { fetchFrontSetting } from "../../store/action/frontSettingAction";
import ShowPayment from "../../shared/showPayment/ShowPayment";
import TopProgressBar from "../../shared/components/loaders/TopProgressBar";
import { getDateFormat } from "../../frontend/shared/SharedMethod";
import {
    fetchQuotationPurchases,
    fetchQuotationPurchase,
} from "../../store/action/quotationToPurchaseAction";
import { fetchSanctionLetters } from "../../store/action/sanctionLetterAction";
import { setLoading } from "../../store/action/loadingAction";
import easyinvoice from "easyinvoice";

const Purchases = (props) => {
    const {
        fetchQuotationPurchase,
        fetchSanctionLetters,
        quotationPurchase,
        fetchPurchases,
        fetchAllWarehouses,
        fetchAllSuppliers,
        purchases,
        totalRecord,
        isLoading,
        suppliers,
        purchasePdfAction,
        frontSetting,
        fetchFrontSetting,
        allConfigData,
        fetchQuotationPurchases,
        sanctionLetters,
    } = props;
    const [deleteModel, setDeleteModel] = useState(false);
    const [isDelete, setIsDelete] = useState(null);
    const [isShowPaymentModel, setIsShowPaymentModel] = useState(false);
    const currencySymbol =
        frontSetting &&
        frontSetting.value &&
        frontSetting.value.currency_symbol;

    const [tableArray, setTableArray] = useState([]);
    const [filteredSupplier, setFilteredSupplier] = useState({});

    const dispatch = useDispatch();

    const data = {
        images: {
            logo: "",
            background:
                "https://public.easyinvoice.cloud/img/watermark-draft.jpg",
        },
        sender: {
            company: "Sample Corp",
            address: "Sample Street 123",
            zip: "1234 AB",
            city: "Sampletown",
            country: "Samplecountry",
        },
        client: {
            company: "Sample Company",
            address: "Sample Address",
            zip: "404040",
            city: "Nagpur",
            country: "India",
        },
        information: {
            number: "2022.0001",
            date: moment().format("YYYY-MM-DD"),
            "due-date": "N/A",
        },
        products: [],
        "bottom-notice": "Kindly pay your invoice within 15 days.",
        settings: {
            currency: "INR",
            "tax-notation": "GST",
            "margin-top": 25,
            "margin-right": 25,
            "margin-left": 25,
            "margin-bottom": 25,
        },
    };

    useEffect(() => {
        fetchFrontSetting();
        fetchSanctionLetters();
    }, []);

    const onClickDeleteModel = (isDelete = null) => {
        setDeleteModel(!deleteModel);
        setIsDelete(isDelete);
    };

    const onChange = (filter) => {
        fetchAllSuppliers();
        // fetchAllWarehouses();
        // fetchPurchases(filter, true);

        fetchQuotationPurchases(filter, true);
    };

    const goToEditProduct = async (item) => {
        const id = item.id;
        await fetchQuotationPurchase(id);
        window.location.href = "#/admin/pos/purchases/edit/" + id;
    };

    const goToDetailScreen = (ProductId) => {
        window.location.href = "#/admin/pos/purchases/detail/" + ProductId;
    };

    const onShowPaymentClick = () => {
        setIsShowPaymentModel(!isShowPaymentModel);
    };

    //onClick pdf function

    const renderInvoices = async (matter, item) => {
        dispatch(setLoading(true));
        const result = await easyinvoice.createInvoice(matter);
        if (result) {
            dispatch(setLoading(false));
            easyinvoice.download(item.reference_code, result.pdf);
            // easyinvoice.render("pdf", result.pdf);
        }
    };
    const onPdfClick = (id, item) => {
        data.products = item?.purchase_items.map((item) => {
            return {
                quantity: item?.quantity,
                description: item?.name,
                "tax-rate": 18,
                price: item?.price,
            };
        });
        data.sender.company = item.supplierObj.attributes.name;
        data.sender.address = item.supplierObj.attributes.address;
        data.sender.city = item.supplierObj.attributes.city;
        data.sender.country = item.supplierObj.attributes.country;
        data.sender.zip = item.supplierObj.attributes.zip
            ? item.supplierObj.attributes.zip
            : "";
        data.client.company = frontSetting.value.company_name;
        data.client.address = frontSetting.value.address;
        data.client.city = frontSetting.value.city;
        data.client.country = frontSetting.value.country;
        data.client.zip = frontSetting.value.zip ? frontSetting.value.zip : "";
        console.log({ item });
        renderInvoices(data, item);
    };

    const itemsValue =
        quotationPurchase.length >= 0
            ? quotationPurchase.map((purchase) => {
                  const supplier =
                      suppliers.length &&
                      suppliers.find((supplier) =>
                          supplier.id == purchase.supplier_id ? supplier : null
                      );
                  const supplierName =
                      supplier &&
                      supplier.attributes &&
                      supplier.attributes.name;
                  const selectedSanctionLetter = sanctionLetters.find(
                      (letter) => letter.id == purchase.sanction_letter_id
                  );
                  return {
                      ...purchase,
                      frontSetting: frontSetting,
                      supplierObj: supplier,
                      reference_code: purchase.reference_code,
                      supplier: supplierName,
                      sanction_letter:
                          selectedSanctionLetter &&
                          selectedSanctionLetter.subject,
                      status: purchase.purchase_status,
                      paid: 0,
                      due: 0,
                      paid_amount: purchase.paid_amount,
                      payment: purchase.payment_type,
                      date: getFormattedDate(
                          purchase.created_at,
                          allConfigData && allConfigData
                      ),
                      time: moment(purchase.created_at).format("LT"),
                      grand_total: purchase.grand_total,
                      currency: currencySymbol,
                      id: purchase.id,
                  };
              })
            : [];

    useEffect(() => {
        const grandTotalSum = () => {
            let x = 0;
            itemsValue.length &&
                itemsValue.map((item) => {
                    x = x + Number(item.grand_total);
                    return x;
                });
            return x;
        };
        const paidTotalSum = (itemsValue) => {
            let x = 0;
            itemsValue.length &&
                itemsValue.map((item) => {
                    x = x + Number(item.paid_amount);
                    return x;
                });
            return x;
        };
        if (quotationPurchase.length) {
            const newObject = itemsValue.length && {
                date: "",
                time: "",
                reference_code: "Total",
                sanction_letter: "",
                supplier: "",
                status: "",
                payment_status: "",
                payment_type: "",
                grand_total: grandTotalSum(itemsValue),
                paid_amount: paidTotalSum(itemsValue),
                paid: 0,
                due: 0,
                id: "",
                payment: "",
                currency: currencySymbol,
            };
            const newItemValue =
                itemsValue.length && newObject && itemsValue.concat(newObject);
            const latestArray =
                newItemValue.length && newItemValue.map((item) => item);
            newItemValue.length &&
                quotationPurchase.length &&
                setTableArray(latestArray);
            // console.log({
            //     newItemValue,
            //     latestArray,
            //     itemsValue,
            // });
        }
    }, [quotationPurchase, sanctionLetters]);

    console.log({ frontSetting, suppliers, quotationPurchase });

    useEffect(() => {
        if (quotationPurchase.length === 0) {
            setTableArray([]);
        }
    }, [quotationPurchase]);

    const columns = [
        {
            name: getFormattedMessage("dashboard.recentSales.reference.label"),
            sortField: "reference_code",
            sortable: true,
            cell: (row) => {
                return row.reference_code === "Total" ? (
                    <span className="fw-bold fs-4">
                        {getFormattedMessage("pos-total.title")}
                    </span>
                ) : (
                    <span className="badge bg-light-danger">
                        <span>{row.reference_code}</span>
                    </span>
                );
            },
        },
        {
            name: getFormattedMessage("supplier.title"),
            selector: (row) => row.supplier,
            sortField: "supplier",
            sortable: true,
        },
        {
            name: "SANCTION LETTER",
            selector: (row) => row.sanction_letter,
            sortField: "sanctionLetter",
            sortable: true,
        },
        {
            name: getFormattedMessage("purchase.select.status.label"),
            sortField: "status",
            sortable: true,
            cell: (row) => {
                return (
                    (row.status === 1 && (
                        <span className="badge bg-light-success">
                            <span>
                                {getFormattedMessage(
                                    "status.filter.received.label"
                                )}
                            </span>
                        </span>
                    )) ||
                    (row.status === 2 && (
                        <span className="badge bg-light-primary">
                            <span>
                                {getFormattedMessage(
                                    "status.filter.pending.label"
                                )}
                            </span>
                        </span>
                    )) ||
                    (row.status === 3 && (
                        <span className="badge bg-light-warning">
                            <span>
                                {getFormattedMessage(
                                    "status.filter.ordered.label"
                                )}
                            </span>
                        </span>
                    ))
                );
            },
        },
        {
            name: getFormattedMessage("purchase.grant-total.label"),
            // selector: row => row.currency + ' ' + parseFloat(row.grand_total).toFixed(2),
            sortField: "grand_total",
            cell: (row) => {
                return row.reference_code === "Total" ? (
                    <span className="fw-bold fs-4">
                        {currencySymbolHendling(
                            allConfigData,
                            row.currency,
                            row.grand_total
                        )}
                    </span>
                ) : (
                    <span>
                        {currencySymbolHendling(
                            allConfigData,
                            row.currency,
                            row.grand_total
                        )}
                    </span>
                );
            },
            sortable: true,
        },
        {
            name: getFormattedMessage("dashboard.recentSales.paid.label"),
            // selector: row => row.currency + ' ' + parseFloat(row.paid).toFixed(2),
            sortField: "paid",
            cell: (row) => {
                return row.reference_code === "Total" ? (
                    <span className="fw-bold fs-4">
                        {currencySymbolHendling(
                            allConfigData,
                            row.currency,
                            row.paid_amount
                        )}
                    </span>
                ) : (
                    <span>
                        {currencySymbolHendling(
                            allConfigData,
                            row.currency,
                            row.paid_amount
                        )}
                    </span>
                );
            },
            sortable: false,
        },
        {
            name: "PAYMENT STATUS",
            cell: (row) => {
                return row.reference_code === "Total" ? (
                    <span className="fw-bold fs-4"></span>
                ) : row.payment_status === 1 ? (
                    <span className="fw-bold badge bg-light-success">
                        <span>Paid</span>
                    </span>
                ) : (
                    <span className="fw-bold badge bg-light-danger">
                        <span>UnPaid</span>
                    </span>
                );
            },
            sortField: "due",
            sortable: false,
        },
        {
            name: getFormattedMessage(
                "globally.react-table.column.payment-type.label"
            ),
            selector: (row) => row.payment,
            sortField: "payment",
            sortable: false,
            cell: (row) => {
                return row.reference_code === "Total" ? (
                    ""
                ) : row.payment_type == 1 ? (
                    <span className="badge bg-light-success">
                        <span>Cash</span>
                    </span>
                ) : row.payment_type == 2 ? (
                    <span className="badge bg-light-success">
                        <span>Cheque</span>
                    </span>
                ) : row.payment_type == 3 ? (
                    <span className="badge bg-light-success">
                        <span>Bank Transfer</span>
                    </span>
                ) : (
                    <span className="badge bg-light-success">
                        <span>Other</span>
                    </span>
                );
            },
        },
        // {
        //     name: "DELIVERY STATUS",
        //     selector: (row) => row.payment,
        //     sortField: "payment",
        //     sortable: false,
        //     cell: (row) => {
        //         return (
        //             (row.delivery_status === 1 && (
        //                 <span className="badge bg-light-success">
        //                     <span>Received</span>
        //                 </span>
        //             )) ||
        //             (row.delivery_status === 2 && (
        //                 <span className="badge bg-light-primary">
        //                     <span>Pending</span>
        //                 </span>
        //             )) ||
        //             (row.delivery_status === 3 && (
        //                 <span className="badge bg-light-warning">
        //                     <span>Ordered</span>
        //                 </span>
        //             ))
        //         );
        //     },
        // },
        {
            name: getFormattedMessage(
                "globally.react-table.column.created-date.label"
            ),
            selector: (row) => row.date,
            sortField: "date",
            sortable: true,
            cell: (row) => {
                return (
                    row.date && (
                        <span className="badge bg-light-info">
                            <div className="mb-1">{row.time}</div>
                            <div>{row.date}</div>
                        </span>
                    )
                );
            },
        },
        {
            name: getFormattedMessage("react-data-table.action.column.label"),
            right: true,
            ignoreRowClick: true,
            allowOverflow: true,
            button: true,
            cell: (row) =>
                row.reference_code === "Total" ? null : (
                    <ActionDropDownButton
                        item={row}
                        goToEditProduct={goToEditProduct}
                        isEditMode={true}
                        isPdfIcon={row.status === 1 ? true : false}
                        onClickDeleteModel={onClickDeleteModel}
                        isViewIcon={true}
                        onPdfClick={onPdfClick}
                        goToDetailScreen={goToDetailScreen}
                        onShowPaymentClick={onShowPaymentClick}
                        // isPaymentShow={true}
                        title={getFormattedMessage("purchase.title")}
                    />
                ),
        },
    ];

    return (
        <MasterLayout>
            <TopProgressBar />
            <TabTitle title={placeholderText("purchases.title")} />
            <ReactDataTable
                columns={columns}
                items={tableArray}
                onChange={onChange}
                isLoading={isLoading}
                isShowDateRangeField
                // ButtonValue={getFormattedMessage("purchase.create.title")}
                totalRows={totalRecord}
                // to="#/admin/pos/purchases/create"
                isShowFilterField
                isStatus
            />
            <DeletePurchase
                onClickDeleteModel={onClickDeleteModel}
                deleteModel={deleteModel}
                onDelete={isDelete}
            />
            <ShowPayment
                onShowPaymentClick={onShowPaymentClick}
                isShowPaymentModel={isShowPaymentModel}
            />
            {/* <div id="pdf"></div> */}
        </MasterLayout>
    );
};

const mapStateToProps = (state) => {
    const {
        quotationPurchase,
        totalRecord,
        isLoading,
        suppliers,
        frontSetting,
        fetchFrontSetting,
        allConfigData,
        sanctionLetters,
    } = state;
    return {
        sanctionLetters,
        quotationPurchase,
        totalRecord,
        isLoading,
        suppliers,
        frontSetting,
        fetchFrontSetting,
        allConfigData,
    };
};

export default connect(mapStateToProps, {
    fetchAllSuppliers,
    purchasePdfAction,
    fetchFrontSetting,
    fetchQuotationPurchases,
    fetchSanctionLetters,
    fetchQuotationPurchase,
})(Purchases);
